- proto: FoodBreadBaguette
  entities:
  - uid: 9367
    components:
    - type: MetaData
      desc: >-
        Ах, багет — истинное олицетворение французской кулинарной страсти, духа пекарен и теплых утренних булочных, впитавший в себя саму сущность Космической Франции. Представьте себе утро в небольшом городке где-то в космическом Провансе. Розовый рассвет расцвечивает небо, а запах только что испеченного хлеба струится по узким улочкам, наполняя их жизнью. И вот он, багет, сверкающий золотистой корочкой и зовущий к себе прохожих, заманчиво покоясь на витрине местной булочной, «La Boulangerie de Greytide».

        Этот багет — не просто хлеб, это мощное оружие, могучий артефакт и пища для души. На вид он длинный, элегантно изогнутый и слегка хрустящий, покрытый тонкой золотистой корочкой, издающий характерный "кряк" при любом движении. Внутри же — нежная, воздушная мякоть с мелкими пористыми дырочками, в которых таятся ароматы изысканных сортов муки и лёгкие оттенки сливочного масла, как будто багет был пропитан духом южных полей Космической Франции.
